const ContactCard = () => {
    const [contact, setContact] = useState({
        firstName: '',
        lastName: '',
        phone: '+1 (709) 234-',
        email: 'example@gmail.com',
        isFavorite: true
    })
  return (
    <div>ContactCard</div>
  )
}

export default ContactCard
